        { id: 1, title: "Hello world", isDone: true },
        { id: 2, title: "I am Happy", isDone: false },
        { id: 3, title: "Yo", isDone: false }
    ]

    return (
        <div className="App">
            <Todolist tasks = {tasks1} title={title}/>
            <Todolist tasks={tasks1} title={title}/>
        </div>
    );
}

